import React, { useState,useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Table, Modal } from "react-bootstrap";
import "./styles.scss";
import ModalUser from "./modal/Modal";
import fire from '../../../../constants/firebase'

const UsuariosForm = () => {
  const [lgShow, setLgShow] = useState(false);

  const headTable = [
    "Nombres",
    "Apellidos",
    "Identificacion (C.C)",
    "Rol Asociado",
    "Estado",
    "TelÃ©fono",
    "CorreoElectronico",
  ];

  const userTable = [
    "Alejandro",
    "Guespud",
    "111365478",
    "Admin",
    "Activo",
    "31695447",
    "admin@gmail.com",
  ];

  const [userList, setUserList] = useState([]);

  useEffect(() => {
    var ref = fire.database().ref("/usuarios");
    var dataArray = [];
    ref.once("value", function (snapshot) {
      snapshot.forEach(function (childSnapshot) {
        var key = childSnapshot.key;
        var data = childSnapshot.val();

        dataArray.push({
          key: key,
          name: data.name,
          lastName: data.lastName,
          identification: data.identification,
          password: data.password,
          role: data.role,
          state: data.state,
          email: data.email,
          number: data.number,
        });
      });
      setUserList(dataArray);
    });

  }, []);


  return (
    <div className="usuario">
      <div className="head">
        <div className="head--title">
          <h2>
            <img src="https://img.icons8.com/dotty/20/000000/business-group.png" />
            &nbsp;Usuarios Existentes
          </h2>
        </div>
        <div className="head--button">
          <button onClick={() => setLgShow(true)} className="btn btn-secondary">
            Crear
          </button>
        </div>
      </div>
      <Table responsive>
        <thead>
          {/* <tr>
            {Array.from(headTable).map((_, index) => (
              <th className="th__title" key={index}>
                {_}
              </th>
            ))}
            <th className="th__title">Accion</th>
          </tr> */}
             <th className="txt-cabecera-table">Nombres</th>
            <th className="txt-cabecera-table">Apellidos</th>
            <th className="txt-cabecera-table">IdentificaciÃ³n</th>
            <th className="txt-cabecera-table">Rol</th>
            <th className="txt-cabecera-table">Estado</th>
            <th className="txt-cabecera-table">TÃ©lefono</th>
            <th className="txt-cabecera-table">Email</th>
            <th className="txt-cabecera-table">AcciÃ³n</th>
        </thead>
        <tbody>
          <tr>
            {Array.from(userTable).map((_, index) => (
              <td className="td__title" key={_}>
                {_}
              </td>
            ))}
            <td className="td__title">
              &nbsp;
              <img src="https://img.icons8.com/small/15/000000/edit.png" />
              &nbsp;
              <img src="https://img.icons8.com/material/15/000000/delete-forever--v1.png" />
            </td>
          </tr>
          <tr>
            {Array.from(userTable).map((_, index) => (
              <td className="td__title" key={_}>
                {_}
              </td>
            ))}
            <td className="td__title">
              &nbsp;
              <img src="https://img.icons8.com/small/15/000000/edit.png" />
              &nbsp;
              <img src="https://img.icons8.com/material/15/000000/delete-forever--v1.png" />
            </td>
          </tr>
          <tr>
            {Array.from(userTable).map((_, index) => (
              <td className="td__title" key={_}>
                {_}
              </td>
            ))}
            <td className="td__title">
              &nbsp;
              <img src="https://img.icons8.com/small/15/000000/edit.png" />
              &nbsp;
              <img src="https://img.icons8.com/material/15/000000/delete-forever--v1.png" />
            </td>
          </tr>
        </tbody>
      </Table>
      <Modal
        size="lg"
        show={lgShow}
        onHide={() => setLgShow(false)}
        aria-labelledby="example-modal-sizes-title-lg"
      >
        <Modal.Header closeButton></Modal.Header>
        <Modal.Body>
          <ModalUser />
        </Modal.Body>
      </Modal>
    </div>
  );
};

export default UsuariosForm;
